import Table from "react-bootstrap/Table";

export const TransTable = ({ transList }) => {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>Date</th>
          <th>Title</th>
          <th>Income</th>
          <th>Expenses</th>
        </tr>
      </thead>
      <tbody>
        {transList.map(({ _id, title, date, amount, type }) => {
          <tr>
            <td>{date.slice(0, 10)}</td>
            <td>{title}</td>
            {type === "income"}
            <td>{amount}</td>
            <td>@mdo</td>
          </tr>;
        })}
      </tbody>
    </Table>
  );
};
